script: |
  super -f text -I q8090.spq | sort > q8090.out

inputs:
  - name: q8090.spq
    data: |
      SELECT DISTINCT - col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT + col0 BETWEEN col1 + + col0 AND - col2;
  - name: tab1

outputs:
  - name: q8090.out
    data: |
      -51
      -85
      -91
